import './App.css';
import React from 'react'
import Content from './Componets/Content'
import NoteState from './reducer/NoteState'
import FileState from './reducer/NoteState'


export default function App() {
  return (
    <>
      <NoteState >
        <FileState>
          <Content />
        </FileState>
      </NoteState>
    </>
  )
}

